 <!--
 table.graph .edge,table.graph .edge_alw,table.graph .edge_inv,table.graph .edge_opt {

  margin: 0.1em;

}
table.graph .edge_alw {
  end: west;

}
table.graph .edge_inv {

}
table.graph .edge_opt {

  start: south, 0;
}
table.graph {

}
table.graph .group_anon {
  border-style: none;
}
table.graph .node,table.graph .node_anon,table.graph .node_attr {
  text-align: center;
  border-color: #000000;
  border-style: solid;
  border-width: 1px;
  background: #ffffff;
  margin: 0.1em;
  padding: 0.2em;
  padding-left: 0.3em;
  padding-right: 0.3em;
}
table.graph .node_anon {
  border-style: none;
}
table.graph .node_attr {
  border-style: dashed;
}
table.graph td {
  padding: 2px;
  background: inherit;
  white-space: nowrap;
  }
table.graph span.l { float: left; }
table.graph span.r { float: right; }
table.graph .va {
  vertical-align: middle;
  line-height: 1em;
  width: 0.4em;
  }
table.graph .el {
  width: 0.1em;
  max-width: 0.1em;
  min-width: 0.1em;
  }
table.graph .lh, table.graph .lv {
  font-size: 0.8em;
  padding-left: 0.4em;
  }
table.graph .sv, table.graph .sh, table.graph .shl, table.graph .sa, table.graph .su {
  max-height: 1em;
  line-height: 1em;
  position: relative;
  top: 0.55em;
  left: -0.3em;
  overflow: visible;
  }
table.graph .sv, table.graph .su {
  max-height: 0.5em;
  line-height: 0.5em;
  }
table.graph .shl { left: 0.3em; }
table.graph .sv { left: -0.5em; top: -0.4em; }
table.graph .su { left: -0.5em; top: 0.4em; }
table.graph .sa { left: -0.3em; top: 0; }
table.graph .eb { max-height: 0; line-height: 0; height: 0; }
 -->
